css:
.github-StubItem-git-tab-controller {
  flex: 1;
  display: flex;
}
.github-PanelEtchWrapper {
  flex: 1;
  display: flex;
  min-width: 0;
}
.github-Panel {
  flex: 1;
  display: flex;
  flex-direction: column;
  min-width: 0;
  font-family: system-ui;
  font-size: 12px;
  color: #a8a8a8;
  -webkit-user-select: none;
  cursor: default;
}
.github-Panel.no-repository {
  padding: 30px;
  text-align: center;
}
.github-Panel.is-loading {
  color: rgba(168, 168, 168, 0.6);
}
.github-Panel.no-repository {
  display: flex;
  justify-content: center;
  font-size: 1.25em;
}
.github-Panel.no-repository > * {
  margin: 10px 0;
}
.github-Panel.no-repository .git-logo-path {
  fill: #5b5b5b;
}
.github-Panel.no-repository .btn.btn-primary {
  overflow: hidden;
  text-overflow: ellipsis;
}
atom-dock.bottom .github-Panel {
  flex-direction: row;
}
atom-dock.bottom .github-PanelEtchWrapper,
atom-dock.bottom .github-StagingView {
  display: contents;
}
atom-dock.bottom .github-Panel > div {
  flex: 1;
}
atom-dock.bottom .github-StagedChanges {
  border-left: 1px solid #1f1f1f;
  border-right: 1px solid #1f1f1f;
}
atom-dock.bottom .github-StagingView-header {
  flex-wrap: wrap;
}
atom-dock.bottom .github-StagingView-group:first-child .github-StagingView-header {
  border-top: 1px solid #1f1f1f;
}
atom-dock.bottom .github-RecentCommits {
  max-height: none;
  border-left: 1px solid #1f1f1f;
}
